import React from 'react';
import ReactDOM from 'react-dom/client';

export default function About() {
  return (
    <div className="about">
      <h3 className="about--title">About</h3>
      <p className="about--paragraph">
      As a frontend developer, my passion lies in crafting streamlined experiences and automating everyday processes. 
            Simplifying complexities and enhancing efficiency are my driving forces.
            I prioritize staying abreast of cutting-edge security measures and industry best practices,
            constantly seeking fresh knowledge to expand my skill set.
      </p>
    </div>
  );
}
